
def writefile(hdcppart,pathhexa,dated,fname):
	fin = "\n"+"!!!!!!!!!!!"+"\n"+"Found : " + str(hdcppart) + "\n"
	file = open(pathhdcp + fname + dated + ".hdcp", "a")
	file.write(fin)
	file.close()
def writefile2(hdcppart,find,pathhexa,dated,fname):
        fin = "\n"+""+"\n"+"Found : " + str(hdcppart) + "\n" + "here too !!!!! :",find
        file = open(pathhdcp + fname + dated + ".hdcp", "a")
        file.write(fin)
        file.close()


